(()=>{"use strict";window.projectRepo=new class{getProjects(){return fetch("http://GroupCode/projects.php",{mode:"no-cors"}).then((t=>{console.log(t.json())}))}getProject(t){return fetch(`http://localhost:3333/projects/${t}`).then((t=>t.json()))}removeProject(t){return fetch(`http://localhost:3333/projects/${t}`,{method:"DELETE"}).then((t=>t.json()))}sortProjectsByDefault(t){return fetch(`http://localhost:3333/projects?${t}`).then((t=>t.json()))}getSearchUsers(t){return fetch(`http://localhost:3333/projects?name_like=${t}`).then((t=>t.json()))}},projectRepo.getProject(id).then((t=>{var e;e=t,document.getElementById("project-field__table-body").insertAdjacentHTML("beforeend",`\n            <tr data-key="${e.id}">\n                <td>${e.name}</td>\n                <td>${e.dateOfChange}</td>\n                <td>${e.numberOfParticipants}</td>\n                ${e.id==role.project?`<td>${role.roles}</td>`:null}\n                <td><img src="./img/repository-page/edit-icon.svg" alt=""></td>\n                <td><img  class="remove-project-btn" src="./img/repository-page/delete-icon.svg" alt=""></td>\n            </tr>\n        `)}))})();